export default function AdminImportPageFactory(model) {
    return async function AdminImportPage(req, res, ctx) {
        if (res.body || (res.code && res.code !== 200)) {
            return;
        }
        if (req.method === 'POST') {
            const response = await ctx.resolve(`${model.dash}-batch`, req);
            res.fromStatusResponse(response);
        }
    };
}
;
